INSERT INTO addons (addon_id, name, target_ide_id, creator_id, description, binary_content_id, origin_url, upload_date, last_commit_date, last_commit_message, downloads, state_id, open_issues_count, pull_requests_count, is_featured) VALUES (143, 'Python', 2, 53, 'Python extension for Visual Studio Code A Visual Studio Code extension with rich support for the Python language (for all actively supported versions of the language: >=3.7), including features such as IntelliSense (Pylance), linting, debugging, code navigation, code formatting, refactoring, variable explorer, test explorer, and more! Installed extensions The Python extension will automatically install the Pylance, Jupyter and isort extensions to give you the best experience when working with Python files and Jupyter notebooks. However, Pylance is an optional dependency, meaning the Python extension will remain fully functional if it fails to be installed. You can also uninstall it at the expense of some features if you’re using a different language server.', 26, 'https://github.com/Microsoft/vscode-python', '2022-12-02 21:30:50', '2022-11-30 17:05:04', 'Simplify launch debug (#20286)
INSERT INTO addons (addon_id, name, target_ide_id, creator_id, description, binary_content_id, origin_url, upload_date, last_commit_date, last_commit_message, downloads, state_id, open_issues_count, pull_requests_count, is_featured) VALUES (149, 'Symfony Support', 1, 58, 'This is a nice plugin that make things easier. It looks like doesn''t work for translations tho, as it''s not suggesting any available translation when using the t() function on a controller.', 32, 'https://github.com/Haehnchen/idea-php-symfony2-plugin', '2022-11-27 10:02:25', '2022-11-13 22:03:38', 'empty', 0, 2, 0, 0, 0);
INSERT INTO addons (addon_id, name, target_ide_id, creator_id, description, binary_content_id, origin_url, upload_date, last_commit_date, last_commit_message, downloads, state_id, open_issues_count, pull_requests_count, is_featured) VALUES (151, 'PHP Annotations', 13, 58, 'Extends PhpStorm to support annotations in DocBlocks and provide additional Attributes features. Good plugin. It would be good if autocompletion was also triggered from incomplete references, not only in empty phpDoc tags; or at least this behaviour would be explained here.', 34, 'https://github.com/Haehnchen/idea-php-annotation-plugin', '2022-12-02 21:33:16', '2022-11-30 17:11:33', 'build 8.3.0', 5154, 3, 21, 30, 0);
INSERT INTO addons (addon_id, name, target_ide_id, creator_id, description, binary_content_id, origin_url, upload_date, last_commit_date, last_commit_message, downloads, state_id, open_issues_count, pull_requests_count, is_featured) VALUES (153, 'Grep Console', 1, 61, 'Grep, tail, filter, highlight... everything you need for a console (JS/NPM/GoLand/... Terminals are not supported - IDEA-216442). Also can highlight the editor... Manage pull requests and conduct code reviews in your IDE with full source-tree context. Comment on any line, not just the diffs. Use jump-to-definition, your favorite keybindings, and code intelligence with more of your workflow.', 36, 'https://github.com/krasa/GrepConsole', '2022-12-02 21:33:16', '2022-08-14 09:15:19', '#239 multiline column for highlighting', 56411, 3, 30, 21, 0);
INSERT INTO addons (addon_id, name, target_ide_id, creator_id, description, binary_content_id, origin_url, upload_date, last_commit_date, last_commit_message, downloads, state_id, open_issues_count, pull_requests_count, is_featured) VALUES (154, 'Flutter', 1, 62, 'Support for developing Flutter applications. Flutter gives developers an easy and productive way to build and deploy cross-platform, high-performance mobile apps for both Android and iOS. Installing this plugin will also install the Dart plugin. For some tools, this plugin uses Chromium through JxBrowser to display content from the web. JxBrowser complies with LGPL and offers an option to replace Chromium with another component. To do this: Find the JxBrowser files stored in the plugins directory, under /flutter-intellij/jxbrowser. Use the instructions and build script from JxBrowser to relink it with modified components.', 37, 'https://github.com/flutter/flutter-intellij', '2022-12-02 21:33:50', '2022-11-15 22:47:44', 'Catch exception if default project was disposed (#6401)', 61612, 3, 521, 30, 1);
INSERT INTO addons (addon_id, name, target_ide_id, creator_id, description, binary_content_id, origin_url, upload_date, last_commit_date, last_commit_message, downloads, state_id, open_issues_count, pull_requests_count, is_featured) VALUES (155, 'GraphQL', 6, 63, 'GraphQL language support including tagged template literals in JavaScript and TypeScript. Formerly known as JS GraphQL. Feature highlights: Schema-aware completion, error highlighting, and documentation. Syntax highlighting, code-formatting, folding, commenter, and brace-matching. Execute queries and mutations with variables against configurable endpoints. Support for multiple schemas using graphql-config. More information about configuring and using the plugin can be found in the documentation.', 38, 'https://github.com/JetBrains/js-graphql-intellij-plugin', '2022-12-02 21:33:50', '2022-12-01 11:12:31', 'README updates (#626)', 65165, 3, 120, 30, 1);
INSERT INTO addons (addon_id, name, target_ide_id, creator_id, description, binary_content_id, origin_url, upload_date, last_commit_date, last_commit_message, downloads, state_id, open_issues_count, pull_requests_count, is_featured) VALUES (156, 'EduTools', 1, 57, 'The EduTools plugin empowers users around the world to learn and teach programming languages such as Kotlin, Java, Python, JavaScript, Rust, Scala, C/C++, Go, and PHP, through interactive courses right in their JetBrains IDEs. More than 700,000 users have already started learning or teaching programming with EduTools!  As a learner, you can enjoy a unique, interactive way to study programming while gaining experience with professional development tools. You can join a public programming course, work on JetBrains Academy real-world projects, complete CheckiO missions, participate in Codeforces contests, or enroll in a custom course created by your professor or co-worker. Read the Learner Start Guide for more information. As an educator, you can pass your programming knowledge on to your students, co-workers, or social media followers by creating your own courses and sharing them either privately or publicly. You can combine theoretical learning and hands-on practice in your courses, test user knowledge with different sets of tasks, and provide extra assistance with feedback and hints. Read the Educator Start Guide for more information.', 39, 'https://github.com/JetBrains/educational-plugin', '2022-11-27 11:15:46', '2022-11-13 22:03:38', 'empty', 0, 2, 0, 0, 0);
INSERT INTO addons (addon_id, name, target_ide_id, creator_id, description, binary_content_id, origin_url, upload_date, last_commit_date, last_commit_message, downloads, state_id, open_issues_count, pull_requests_count, is_featured) VALUES (157, 'Heap Allocations Viewer', 16, 64, 'Highlights local object allocations, boxing, delegates and closure creations points. What’s New: Added support for ReSharper and Rider 2022.3', 40, 'https://github.com/controlflow/resharper-heapview', '2022-11-27 11:22:44', '2022-11-13 22:03:38', 'empty', 0, 2, 0, 0, 0);
INSERT INTO addons (addon_id, name, target_ide_id, creator_id, description, binary_content_id, origin_url, upload_date, last_commit_date, last_commit_message, downloads, state_id, open_issues_count, pull_requests_count, is_featured) VALUES (158, 'AWS Toolkit', 1, 65, 'The AWS Toolkit for JetBrains makes it easier to write applications built on Amazon Web Services. If you come across bugs with the toolkit or have feature requests, please raise an issue on our GitHub repository. See the user guide for how to get started, along with what features/services are supported. Features: Amazon CodeWhisperer - CodeWhisperer uses machine learning to generate code suggestions from the existing code and comments in your IDE. Supported languages include: Java, Python, and JavaScript. In addition to providing code suggestions within your current file, CodeWhisperer can scan your code package to identify security issues. Authentication - Connect to AWS using static credentials, credential process, or AWS SSO. Resource Explorer - View and manage AWS resources Run/Debug Local Lambda Functions - Locally test and step-through debug functions in a Lambda-like execution environment provided by the AWS SAM CLI. Supports Java, Python, Node.js, and .NET Core. Deploy SAM-based Applications - Package, deploy & track SAM-based applications CloudWatch Logs - View and search CloudWatch log streams S3 Explorer - Manage S3 buckets, and upload to/download from S3 buckets See the user guide for a full list of services and features supported', 41, 'https://github.com/aws/aws-toolkit-jetbrains', '2022-11-27 11:29:52', '2022-11-13 22:03:38', 'empty', 0, 2, 0, 0, 0);
INSERT INTO addons (addon_id, name, target_ide_id, creator_id, description, binary_content_id, origin_url, upload_date, last_commit_date, last_commit_message, downloads, state_id, open_issues_count, pull_requests_count, is_featured) VALUES (159, 'Vue.js', 1, 57, 'Support for Vue.js projects. Getting started Open your Vue.js project. Make sure you have Vue.js listed in your project dependencies in package.json and it is installed. Now, you will get Vue-specific code completion, navigation, and many other features in .vue files. %nFeatures %nCompletion for components, directives, props and methods in templates Navigation from the component, directives and event handlers to their definition %nCoding assistance for different languages inside template, script and style tags in .vue files %nExtract component and rename component refactorings %nCollection of code snippets for Vue.js %nCreate new projects from the IDE Welcome screen using Vue CLI %n Learn more about Vue.js support in the IDE documentation.', 42, 'https://github.com/aws/aws-toolkit-jetbrains', '2022-11-27 11:35:30', '2022-11-13 22:03:38', 'empty', 0, 2, 0, 0, 0);
INSERT INTO addons (addon_id, name, target_ide_id, creator_id, description, binary_content_id, origin_url, upload_date, last_commit_date, last_commit_message, downloads, state_id, open_issues_count, pull_requests_count, is_featured) VALUES (160, 'New Relic CodeStream: GitHub', 1, 66, 'New Relic CodeStream is a developer collaboration platform that integrates all of your essential dev tools into your IDE. Eliminate context-switching and simplify code discussion and code review by putting collaboration tools in your IDE.', 43, 'https://github.com/TeamCodeStream/codestream', '2022-12-02 21:30:50', '2022-12-02 18:02:16', 'Auto bump version on develop to 14.9.3 for next release', 90, 3, 110, 30, 0);
INSERT INTO addons (addon_id, name, target_ide_id, creator_id, description, binary_content_id, origin_url, upload_date, last_commit_date, last_commit_message, downloads, state_id, open_issues_count, pull_requests_count, is_featured) VALUES (167, 'Svelte', 1, 57, 'Support for Svelte in your IDE of choice. Features Syntax highlighting Code formatting Typing assistance Emmet-style abbreviations of Svelte blocks Completions of components, props and some directives Auto import of components Navigation from components to their definition Debugger integration', 50, 'https://github.com/tomblachut/svelte-intellij', '2022-12-02 21:30:51', '2022-11-22 22:23:31', '[svelte] provide file type name
INSERT INTO addons (addon_id, name, target_ide_id, creator_id, description, binary_content_id, origin_url, upload_date, last_commit_date, last_commit_message, downloads, state_id, open_issues_count, pull_requests_count, is_featured) VALUES (168, 'SpecFlow for Rider', 16, 67, 'Adds support for syntax highlighting, smart navigation, and auto-completion to help you write better Gherkin feature files and automation code. What’s New Plugin Versions - Hide live template and other completion items added by other plugin when completing steps - Add support for backticks in Doc strings (multiline string) [#75](https://github.com/SpecFlowOSS/SpecFlow.Rider/issues/75) (- When specflow.json is not available, use config from App.config [#162](https://github.com/SpecFlowOSS/SpecFlow.Rider/issues/162)- Disable code completion in case of adding spaces before a step. [#147](https://github.com/SpecFlowOSS/SpecFlow.Rider/issues/147)- Do not show unresolved step warning for ignored scenarios. [#137](https://github.com/SpecFlowOSS/SpecFlow.Rider/issues/137)', 51, 'https://github.com/SpecFlowOSS/SpecFlow.Rider', '2022-11-27 13:23:05', '2022-11-13 22:03:38', 'empty', 0, 2, 0, 0, 0);
INSERT INTO addons (addon_id, name, target_ide_id, creator_id, description, binary_content_id, origin_url, upload_date, last_commit_date, last_commit_message, downloads, state_id, open_issues_count, pull_requests_count, is_featured) VALUES (169, 'CognitiveComplexity', 16, 68, 'Implements live calculation of the Cognitive Complexity metric, which was proposed by G. Ann Campbell in Cognitive Complexity - A new way of measuring understandability (c) SonarSource S.A. 2016-2018, Switzerland.', 52, 'https://github.com/matkoch/resharper-cognitivecomplexity', '2022-11-27 13:26:36', '2022-11-13 22:03:38', 'empty', 0, 2, 0, 0, 0);
INSERT INTO addons (addon_id, name, target_ide_id, creator_id, description, binary_content_id, origin_url, upload_date, last_commit_date, last_commit_message, downloads, state_id, open_issues_count, pull_requests_count, is_featured) VALUES (171, 'Rainbow Brackets', 1, 70, 'Eliminate context switching and costly distractions. Create and merge PRs and perform code reviews from inside your IDE while using jump-to-definition, your keybindings, and other IDE favorites. Learn more Supported languages: Java, Scala, Clojure, Kotlin, Python, Haskell, Agda, Rust, JavaScript, TypeScript, Erlang, Go, Groovy, Ruby, Elixir, ObjectiveC, PHP, HTML, XML, SQL, Apex language, C#, Dart, Pug/Jade, Bash, Vue.js, C# Razor Pages, GLSL(the OpenGL Shading Language), Go Template, C++, C, Solidity...', 56, 'https://github.com/izhangzhihao/intellij-rainbow-brackets', '2022-12-03 12:50:51', '2022-11-13 22:03:38', null, 0, 2, 0, 0, 0);
INSERT INTO addons (addon_id, name, target_ide_id, creator_id, description, binary_content_id, origin_url, upload_date, last_commit_date, last_commit_message, downloads, state_id, open_issues_count, pull_requests_count, is_featured) VALUES (173, 'HTML CSS Support', 2, 71, 'Visual Studio Code CSS Intellisense for HTML HTML id and class attribute completion for Visual Studio Code. Features HTML id and class attribute completion. Supports linked and embedded style sheets. Supports template inheritance. Supports additional style sheets. Supports other HTML like languages. Validates CSS selectors on demand.', 57, 'https://github.com/ecmel/vscode-html-css', '2022-12-03 12:50:51', '2022-11-13 22:03:38', null, 0, 2, 0, 0, 0);
INSERT INTO addons (addon_id, name, target_ide_id, creator_id, description, binary_content_id, origin_url, upload_date, last_commit_date, last_commit_message, downloads, state_id, open_issues_count, pull_requests_count, is_featured) VALUES (174, 'Vetur', 2, 72, 'Vetur is my main focus in Open Source. Your help will alleviate my financial burden and allow me to spend more time working on Vetur.', 58, 'https://github.com/vuejs/vetur', '2022-12-03 12:50:51', '2022-11-13 22:03:38', null, 0, 2, 0, 0, 0);
INSERT INTO addons (addon_id, name, target_ide_id, creator_id, description, binary_content_id, origin_url, upload_date, last_commit_date, last_commit_message, downloads, state_id, open_issues_count, pull_requests_count, is_featured) VALUES (175, 'Auto Rename Tag', 2, 73, 'Increase your coding productivity with Tabnine’s AI code completions! Tabnine is a free powerful Artificial Intelligence assistant designed to help you code faster, reduce mistakes, and discover best coding practices - without ever leaving the comfort of VS Code.', 59, 'https://github.com/formulahendry/vscode-auto-rename-tag', '2022-12-03 12:50:51', '2022-11-13 22:03:38', null, 0, 2, 0, 0, 0);
INSERT INTO addons (addon_id, name, target_ide_id, creator_id, description, binary_content_id, origin_url, upload_date, last_commit_date, last_commit_message, downloads, state_id, open_issues_count, pull_requests_count, is_featured) VALUES (176, 'Live Share', 2, 53, 'Microsoft Visual Studio Live Share Visual Studio Live Share enables you to collaboratively edit and debug with others in real time, regardless what programming languages you''re using or app types you''re building. It allows you to instantly (and securely) share your current project, and then as needed, share debugging sessions, terminal instances, localhost web apps, voice calls, and more! Developers that join your sessions receive all of their editor context from your environment (e.g. language services, debugging), which ensures they can start productively collaborating immediately, without needing to clone any repos or install any SDKs. Additionally, unlike traditional pair programming, Visual Studio Live Share allows developers to work together, while retaining their personal editor preferences (e.g. theme, keybindings), as well as having their own cursor. This allows you to seamlessly transition between following one another, and being able to explore ideas/tasks on your own. In practice, this ability to work together and independently provides a collaboration experience that is potentially more natural for many common use cases.', 60, 'https://github.com/MicrosoftDocs/live-share', '2022-12-03 12:50:51', '2022-11-13 22:03:38', null, 0, 2, 0, 0, 0);
